t src="/w/load.php?debug=false&amp;lang=en&amp;modules=html5shiv&amp;only=scripts&amp;skin=vector&amp;sync=1"></script><![endif]--> </head> <body class="mediawiki ltr sitedir-ltr mw-hide-empty-elt ns-0 ns-subject page-Sum rootpage-Sum skin-vector action-view">		<div id="mw-page-base" class="noprint"></div> 		<div id="mw-head-base" class="noprint"></div> 		<div id="content" class="mw-body" role="main"> 			<a id="top"></a> 			<div id="siteNotice" class="mw-body-content"><!-- CentralNotice --></div><div class="mw-indicators mw-body-content"> </div> <h1 id="firstHeading" class="firstHeading" lang="en">Sum</h1>			<div id="bodyContent" class="mw-body-content"> 				<div id="siteSub" class="noprint">From Wikipedia, the free encyclopedia</div>				<div id="contentSub"></div> 								<div id="jump-to-nav" class="mw-jump"> 					Jump to:					<a href="#mw-head">navigation</a>, 					<a href="#p-search">search</a> 				</div> 				<div id="mw-content-text" lang="en" dir="ltr" class="mw-content-ltr"><div class="mw-parser-output"><table role="presentation" class="mbox-small plainlinks sistersitebox" style="background-color:#f9f9f9;border:1px solid #aaa;color:#000"> <tr> <td class="mbox-image"><img alt="" src="//upload.wikimedia.org/wikipedia/commons/thumb/9/99/Wiktionary-logo-en-v2.svg/40px-Wiktionary-logo-en-v2.svg.png" width="40" height="40" class="noviewer" srcset="//upload.wikimedia.org/wikipedia/commons/thumb/9/99/Wiktionary-logo-en-v2.svg/60px-Wiktionary-logo-en-v2.svg.png 1.5x, //upload.wikimedia.org/wikipedia/commons/thumb/9/99/Wiktionary-logo-en-v2.svg/80px-Wiktionary-logo-en-v2.svg.png 2x" data-file-width="391" data-file-height="391" /></td> <td class="mbox-text plainlist">Look up <i><b><a href="https://en.wiktionary.org/wiki/sum" class="extiw" title="wiktionary:sum">sum</a></b></i> in Wiktionary, the free dictionary.</td> </tr> </table> <p><b>Sum</b> may refer to:</p> <p></p> <div id="toc" class="toc"> <div class="toctitle"> <h2>Contents</h2> </div> <ul> <li class="toclevel-1 tocsection-1"><a href="#Mathematics"><span class="tocnumber">1</span> <span class="toctext">Mathematics</span></a></li> <li class="toclevel-1 tocsection-2"><a href="#Other_uses"><span class="tocnumber">2</span> <span class="toctext">Other uses</span></a></li> <li class="toclevel-1 tocsection-3"><a href="#Acronyms"><span class="tocnumber">3</span> <span class="toctext">Acronyms</span></a></li> <li class="toclevel-1 tocsection-4"><a href="#See_also"><span class="tocnumber">4</span> <span class="toctext">See also</span></a></li> </ul> </div> <p></p> <h2><span class="mw-headline" id="Mathematics">Mathematics</span><span class="mw-editsection"><span class="mw-editsection-bracket">[</span><a href="/w/index.php?title=Sum&amp;action=edit&amp;section=1" title="Edit section: Mathematics">edit</a><span class="mw-editsection-bracket">]</span></span></h2> <ul> <li><a href="/wiki/Summation" title="Summation">Summation</a>, the addition of a sequence of numbers</li> <li><a href="/wiki/Addition" title="Addition">Addition</a>, the elementary mathematical operations of arithmetic that totals amount of quantities combined</li> <li><a href="/wiki/Sum_(category_theory)" class="mw-redirect" title="Sum (category theory)">Sum (category theory)</a>, the generic concept of summation in mathematics</li> <li><a href="/wiki/Additive_category" title="Additive category">Additive</a> and <a href="/wiki/Preadditive_category" title="Preadditive category">preadditive category</a></li> <li><a href="/wiki/Band_sum" title="Band sum">Band sum</a>, a way of connecting knots</li> <li><a href="/wiki/Connected_sum" title="Connected sum">Connected sum</a>, a way of gluing manifolds</li> <li><a href="/wiki/Digit_sum" title="Digit sum">Digit sum</a>, in number theory</li> <li><a href="/wiki/Direct_sum" title="Direct sum">Direct sum</a>, a combination of algebraic objects <ul> <li><a href="/wiki/Direct_sum_of_groups" title="Direct sum of groups">Direct sum of groups</a></li> <li><a href="/wiki/Direct_sum_of_topological_groups" title="Direct sum of topological groups">Direct sum of topological groups</a></li> <li><a href="/wiki/Direct_sum_of_modules" title="Direct sum of modules">Direct sum of modules</a></li> <li><a href="/wiki/Direct_sum_of_permutations" class="mw-redirect" title="Direct sum of permutations">Direct sum of permutations</a></li> </ul> </li> <li><a href="/wiki/Einstein_summation" class="mw-redirect" title="Einstein summation">Einstein summation</a>, a way of contracting tensor indecies</li> <li><a href="/wiki/Empty_sum" title="Empty sum">Empty sum</a>, a sum with no terms</li> <li><a href="/wiki/Pushout_(category_theory)" title="Pushout (category theory)">Fibered sum</a> or pushout in category theory</li> <li><a href="/wiki/Indefinite_sum" title="Indefinite sum">Indefinite sum</a>, the inverse of a finite difference</li> <li><a href="/wiki/Matrix_addition" title="Matrix addition">Matrix addition</a>, in linear algebra</li> <li><a href="/wiki/QCD_sum_rules" title="QCD sum rules">QCD sum rules</a>, in quantum field theory</li> <li><a href="/wiki/Power_sum_symmetric_polynomial" title="Power sum symmetric polynomial">Power sum</a>, in commutative algebra</li> <li><a href="/wiki/Prefix_sum" title="Prefix sum">Prefix sum</a>, in computing</li> <li><a href="/wiki/Riemann_sum" title="Riemann sum">Riemann sum</a>, in calculus</li> <li><a href="/wiki/Rule_of_sum" title="Rule of sum">Rule of sum</a> in combinatorics</li> <li><a href="/wiki/Subset_sum_problem" title="Subset sum problem">Subset sum problem</a>, in cryptography</li> <li><a href="/wiki/Sum_rule_in_differentiation" title="Sum rule in differentiation">Sum rule in differentiation</a> in calculus</li> <li><a href="/wiki/Sum_rule_in_integration" title="Sum rule in integration">Sum rule in integration</a> in calculus</li> <li><a href="/wiki/Sum_rule_in_quantum_mechanics" title="Sum rule in quantum mechanics">Sum rule in quantum mechanics</a></li> <li><a href="/wiki/Wedge_sum" title="Wedge sum">Wedge sum</a>, a one-point union of topological spaces</li> <li><a href="/wiki/Whitney_sum" class="mw-redirect" title="Whitney sum">Whitney sum</a> of fiber bundles</li> <li><a href="/wiki/Zero-sum_problem" title="Zero-sum problem">Zero-sum problem</a> in combinatorics</li> <li><a href="/wiki/3SUM" title="3SUM">3SUM</a>, a term from computational complexity theory</li> </ul> <h2><span class="mw-headline" id="Other_uses">Other uses</span><span class="mw-editsection"><span class="mw-editsection-bracket">[</span><a href="/w/index.php?title=Sum&amp;action=edit&amp;section=2" title="Edit section: Other uses">edit</a><span class="mw-editsection-bracket">]</span></span></h2> <ul> <li>Sum, an old name for the <a href="/wiki/Finns" title="Finns">Finns</a> in East Slavic languages, derived from the word Suomi, "Finland"</li> <li><i><a href="/wiki/Sum:_Forty_Tales_from_the_Afterlives" title="Sum: Forty Tales from the Afterlives">Sum: Forty Tales from the Afterlives</a></i>, a 2009 collection of short stories by David Eagleman</li> <li><a href="/wiki/Sum_(Unix)" title="Sum (Unix)">Sum (Unix)</a>, a program for generating checksums</li> <li><a href="/wiki/Sum_(country_subdivision)" title="Sum (country subdivision)">Sum (country subdivision)</a>, an administrative division in Mongolia and nearby regions</li> <li>the local term for one of the <a href="/wiki/Districts_of_Mongolia" title="Districts of Mongolia">districts of Mongolia</a></li> <li><a href="/wiki/Som_(currency)" title="Som (currency)">Som (currency)</a>, the unit of currency used in Turkic-speaking countries of Central Asia</li> <li>the IATA airport code for the <a href="/wiki/Sumter_Airport" title="Sumter Airport">Sumter Airport</a> in Sumter County, South Carolina, USA</li> <li>the ISO 639-3 code for the <a href="/wiki/Sumo_language" class="mw-redirect" title="Sumo language">Sumo language</a></li> <li>the first beat (pronounced like "some") in any rhythmic cycle of <a href="/wiki/Hindustani_classical_music" title="Hindustani classical music">Hindustani classical music</a></li> <li>"Sum", a song by Pink Floyd from <i><a href="/wiki/The_Endless_River" title="The Endless River">The Endless River</a></i></li> </ul> <h2><span class="mw-headline" id="Acronyms">Acronyms</span><span class="mw-editsection"><span class="mw-editsection-bracket">[</span><a href="/w/index.php?title=Sum&amp;action=edit&amp;section=3" title="Edit section: Acronyms">edit</a><span class="mw-editsection-bracket">]</span></span></h2> <p>As an acronym, <b>SUM</b> may refer to:</p> <ul> <li>Senter for utvikling og miljø (<a href="/wiki/Centre_for_Development_and_the_Environment" title="Centre for Development and the Environment">Centre for Development and the Environment</a>), part of the University of Oslo</li> <li><a href="/wiki/SUM_(interbank_network)" title="SUM (interbank network)">SUM (interbank network)</a></li> <li><a href="/wiki/Soccer_United_Marketing" title="Soccer United Marketing">Soccer United Marketing</a></li> <li><a href="/wiki/The_State_University_of_Management" title="The State University of Management">The State University of Management</a>, a Russian university</li> </ul> <h2><span class="mw-headline" id="See_also">See also</span><span class="mw-editsection"><span class="mw-editsection-bracket">[</span><a href="/w/index.php?title=Sum&amp;action=edit&amp;section=4" title="Edit section: See also">edit</a><span class="mw-editsection-bracket">]</span></span></h2> <ul> <li><i><a href="/wiki/Cogito_ergo_sum" title="Cogito ergo sum">Cogito ergo sum</a></i></li> <li><a href="/wiki/Sum_41" title="Sum 41">Sum 41</a>, a Canadian punk band</li> <li><a href="/wiki/Sum_certain" title="Sum certain">Sum certain</a>, a legal term</li> <li><a href="/wiki/Sum_type" class="mw-redirect" title="Sum type">Sum type</a></li> <li><a href="/wiki/Cen_(surname)" title="Cen (surname)">Cen (surname)</a> sometimes romanized Sum</li> </ul> <table id="disambigbox" class="metadata plainlinks dmbox dmbox-disambig" style="" role="presentation"> <